import React from 'react';
import { AiOutlineMenu } from 'react-icons/ai';

const MenuBar = () => {
  return (
    <header>
      <nav>
        <div className="logo">
          <img src="path_to_your_logo.png" alt="Company Logo" />
        </div>
        <div className="menu-icon">
          <AiOutlineMenu />
        </div>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
};

export default MenuBar;
